import React from "react";
import Typewriter from "typewriter-effect"


const AboutMe = () => {
    return (
      <div className="container">
        <p className="about">

          "I'm a passionate newcomer to the world of programming, driven by a relentless thirst for knowledge and a commitment to mastering this ever-evolving craft. My skill set includes JavaScript, HTML/CSS, Angular, React, TypeScript, P5.js, and Nest. As an eager learner, I'm dedicated to continuous growth and problem-solving. I thrive on breaking down complex challenges and believe in the power of collaboration. I'm focused on building a strong foundation in programming, primarily in JavaScript, Angular, and React. I invite fellow enthusiasts, mentors, and professionals to connect with me as we embark on this exciting journey into the world of technology. If you're an experienced programmer, mentor, or a believer in the power of learning, your guidance and support can significantly impact my journey. Thank you for visiting my portfolio, and I look forward to connecting with you."]

        </p>
     </div> 
    )
}

export default AboutMe
